import lift from './res/girl-lift.png'
import './App.css';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';

function App() {
  const alignCenter = { display: 'flex', alignItems: 'center' }
  return (
   <div>
      <Parallax pages={2} >
        <ParallaxLayer
          offset={0}
          speed={1}
          factor={2}
          style={{
            backgroundColor: 'black',
            backgroundSize: 'cover',
          }}
        />

        <ParallaxLayer
          offset={1}
          speed={1}
          factor={4}
          style={{
            backgroundColor: 'black',
            backgroundSize: 'cover',
          }}
        ></ParallaxLayer>

        <ParallaxLayer
          sticky={{ start: 0.3, end: 2.5 }}
          style={{ ...alignCenter, justifyContent: 'flex-start' }}
        >
          <img src={lift} />
        </ParallaxLayer>

        <ParallaxLayer offset={1.5} speed={1.5} style={{ ...alignCenter, justifyContent: 'flex-end' }}>
          <div>
          <p style={{ color: 'white' }}>I'm not</p>
          </div>
        </ParallaxLayer>
      </Parallax>
    </div>
  );
}

export default App;
